import React, {Component} from 'react';
import {ResultCard} from './ResultCard';

export class ResultGroup extends React.Component {
    render() {
        let r = [];
        for (let i = 0; i < 6; i++) {
            r.push(<ResultCard />);
        }
        return (
            <div>
                {r}
            </div>
        )
    }
}

export default function ResultGroupTemp(props) {
    let r = [];
    for (let i = 0; i < props.programs.length; i++) {
        r.push(<ResultCard />);
    }
    return (
        <div>
            {r}
        </div>
    )
}
